export default class CollabCard extends Component {

    render() {
        return (
            <div>
                <Avatar name = "Gabbi"> </Avatar>
                {this.props.name}
            <Row> 
                <Col> <Button onClick={() => this.props.collabDelete(this.props.collaborator)} > 
                    X
                </Button></Col>                 
            </Row>
            </div>
        )
    }
}
